import { Avatar, Box, Fab, Modal, TextField, Tooltip, Typography, styled } from '@mui/material';
import React, { useState } from 'react';
import {Add as AddIcon } from '@mui/icons-material';


const StyledModal=styled(Modal)({
    display:"flex",
    alignItems:"center",
    justifyContent:"center"
})

const UserBox=styled(Box)({
    display:"flex",
    alignItems:"center",
    gap:"10px",
    marginBottom:"20"
})
const Add = () => {
    const [open, setOpen]=useState(false);
  return (

    <>
        <Tooltip onClick={e=>setOpen(true)}
            title="Delete" 
            sx={{
                position:"fixed", 
                bottom:20, 
                left:{xs:"calc(50% - 25px)", 
                md:30
            }}}>
            <Fab color="primary" aria-label="add">
                <AddIcon />
            </Fab>
        </Tooltip>
        <StyledModal
            open={open}
            onClose={e=>setOpen(false)}
            aria-labelledby="modal-modal-title"
            aria-describedby="modal-modal-description"
        >
            <Box width={400} height={280} bgcolor="white" p={3} borderRadius={5}>
                <Typography variant='h6' color="gray" textAlign="center">Create Post</Typography>
                <UserBox>
                    <Avatar 
                        src="https://images.pexels.com/photos/762020/pexels-photo-762020.jpeg?auto=compress&cs=tinysrgb&w=800"
                        sx={{ width: 30, height:30 }}
                    />
                    <Typography fontWeight={500}></Typography>
                </UserBox>
                <TextField
                        id="standard-multiline-static"
                        label="Multiline"
                        multiline
                        rows={4}
                        defaultValue="Default Value"
                        variant="standard"
                />
            </Box>
        </StyledModal>
    </>
  )
}

export default Add
